import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Card, CardActionArea, CardContent, CardMedia, Typography, IconButton, CardHeader } from '@material-ui/core';
import LinkedInIcon from '@material-ui/icons/LinkedIn';

const useStyles = makeStyles({
  
});

export default function MediaCard(props) {
  const classes = useStyles();
  const { name, designation } = props;
  return (
    <Card className={classes.root}>
      <CardHeader
          name = {
            <Typography variant="h6">
              Neelanshi Sharma
            </Typography>
          }
          connect = {
            <IconButton aria-label="connect">
              <LinkedInIcon/>
            </IconButton>
          }
        />
      <CardActionArea>
        <CardMedia
          component="img"
          alt="Contemplative Reptile"
          height="200"
          image="../../images/sample_image.jpg"
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography variant="body2">
          Director of Banking - Buy-Side
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}
